import React from 'react'

import Tour from './Tour'

const Tours = ({tours}) => {
    return(
        <section>
            <div>
                <h1>Tours</h1>
            </div>
            {tours.map((tour) => {
                <div>
                    return(
                        {/* <Tour /> */}
                        <h4>{tour.name}</h4>
                    )
                </div>
            })}
        </section>
    )
}

export default Tours
